con:config.script:
import com.eviware.soapui.support.types.StringToObjectMap

//Modify below as needed
sequenceSuites = ['TestSuite1']
parallelSuites = ['TestSuite2', 'TestSuite3']

//DO NOT MODIFY BEYOND THIS POINT
def project = context.testCase.testSuite.project
def runSuite = { suiteName, async = true ->
	suite = project.testSuites[suiteName]
	suite.run([] as StringToObjectMap, async)
}
println '=====================Running Suite  Sequencially Start====================='
sequenceSuites.each{ runSuite(it, false) }
println '=====================Sequential Execution End==========================='
println '+++++++++++++++++++++Paralled Execution Start++++++++++++++++++++++++++++'
Thread.start{
	parallelSuites.each { runSuite(it) }
}*.join()
println '+++++++++++++++++++++Paralled Execution End++++++++++++++++++++++++++++'
println 'completed'

con:soapui-project.con:afterLoadScript:
def props = new Properties()
new File(System.getProperty("myProject.properties")).withInputStream {
  stream -> props.load(stream)
}
props.each {
  project.setPropertyValue(it.key,it.value)
}
